import Iframe from "react-iframe";
export default function App() {
  return (
    <React.Fragment>
      <Iframe
        url="https://biteable.com/watch/embed/3111536/9fe562d8fb1038d56366ab95cac9c9f5"
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
      />
    </React.Fragment>
  );
}
